import{g as e}from"./app.2025f35b.js";import{_ as o}from"./plugin-vue_export-helper.21dcd24c.js";const t={},d=e('<h1 id="code-generation-rules" tabindex="-1"><a class="header-anchor" href="#code-generation-rules" aria-hidden="true">#</a> Code Generation Rules</h1><p>In addition to understanding the usage of the <code>go-doudou</code> command-line tool, you also need to understand the code generation rules. I have divided the rules into four categories: &quot;Incremental Generation&quot;, &quot;Overwrite Generation&quot;, &quot;Partial Modification&quot;, and &quot;Skip&quot;.</p><h2 id="incremental-generation" tabindex="-1"><a class="header-anchor" href="#incremental-generation" aria-hidden="true">#</a> Incremental Generation</h2><ul><li><p><code>svcimpl.go</code>: Each time you execute the <code>go-doudou svc http</code> command, existing code will not be overwritten, new code will only be added at the end of the file, so you can freely modify the generated code to suit your business needs. Repeated execution of this command will not cause you to lose any manually written code.</p></li><li><p><code>transport/httpsrv/handlerimpl.go</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>--handler</code> parameter, existing code will not be overwritten, new code will only be added at the end of the file, so you can freely modify the generated code to suit your business needs. Repeated execution of this command will not cause you to lose any manually written code.</p></li><li><p><code>client/clientproxy.go</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>-c</code> parameter, existing code will not be overwritten, new code will only be added at the end of the file, so you can freely modify the generated code to suit your business needs. Repeated execution of this command will not cause you to lose any manually written code.</p></li></ul><h2 id="overwrite-generation" tabindex="-1"><a class="header-anchor" href="#overwrite-generation" aria-hidden="true">#</a> Overwrite Generation</h2><ul><li><p><code>transport/httpsrv/handler.go</code>: Each time you execute the <code>go-doudou svc http</code> command, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>client/client.go</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>-c</code> parameter, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>client/iclient.go</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>-c</code> parameter, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>${service}_openapi3.go</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>--doc</code> parameter, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>${service}_openapi3.json</code>: Each time you execute the <code>go-doudou svc http</code> command with the <code>--doc</code> parameter, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>transport/grpc/${service}.pb.go</code>: Each time you execute the <code>go-doudou svc grpc</code> command, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>transport/grpc/${service}.proto</code>: Each time you execute the <code>go-doudou svc grpc</code> command, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>transport/grpc/${service}_grpc.pb.go</code>: Each time you execute the <code>go-doudou svc grpc</code> command, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li><li><p><code>transport/grpc/annotation.go</code>: Each time you execute the <code>go-doudou svc grpc</code> command, the code will be regenerated, so please do not manually modify this file, all manually modified or written code will be lost.</p></li></ul><h2 id="partial-modification" tabindex="-1"><a class="header-anchor" href="#partial-modification" aria-hidden="true">#</a> Partial Modification</h2><ul><li><p><code>${service}_deployment.yaml</code>: Each time you execute the <code>go-doudou svc push</code> command, the value of the <code>image</code> attribute will be updated, i.e., updating the image name</p></li><li><p><code>${service}_statefulset.yaml</code>: Each time you execute the <code>go-doudou svc push</code> command, the value of the <code>image</code> attribute will be updated, i.e., updating the image name</p></li></ul><h2 id="skip" tabindex="-1"><a class="header-anchor" href="#skip" aria-hidden="true">#</a> Skip</h2><p>Other files, if they already exist, will be skipped.</p>',10);function i(a,l){return d}var r=o(t,[["render",i]]);export{r as default};
